  `mch_is` int(11) DEFAULT '0' COMMENT '0子帐号用的是服务商的appid,1子帐号用的是子务商的appid,2普通帐号',
  `not_order_day` int(11) DEFAULT '0' COMMENT '学校支付周期天数0为不作检查',
  `key_` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ID_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='机构（学校）表';

